import React from 'react';
import data from './data.json'
import styles from './App.module.css';
import Header from './components/MenuHeader';
import Menu from './components/Menu.js';
import Ostoskori from './components/Ostoskori';


const sidefiles=[


  {
    topic:'Ostoskori',
    body:'TÄHÄN TULEE OSTOSKORI.'

  },


]

const mainfiles=[
  {
    kuva: 'metto.jpg',
    topic:'Pizzat',
    body:'Tähän lista pizzoista',
    aikajapaikka: '10€'
  },
  {
    kuva: 'lautta.jpg',
    topic:'Burgerit',
    body:'Tähän lista Burgereista',
    aikajapaikka: '12€'
  },
  {
    kuva: 'lynx.jpg',
    topic:'Juomat',
    body:'Tähän lista juomista',
    aikajapaikka: '11€'
  },

]

function App() {

  return (

  <div>
    <Header />
    <div className={styles.paasivubar}>
      <div className={styles.maincontainer}>dgf
        <div className={styles.maincontainer}>
         {
           mainfiles.map(element => <Menu kuva={element.kuva} topic ={element.topic} body={element.body}/>)  
         }
          </div>
         </div>

      <div className={styles.sidecontainer}>
         {
           sidefiles.map(element => <Ostoskori topic ={element.topic}/>)   
         }
 
        </div>
      </div>


    </div>
  )
}

export default App;
